import React, { Component } from "react";
import {
  Route,
  NavLink,
  HashRouter
} from "react-router-dom";
import Resume from "./Resume";
import Projects from "./Projects";
import About from "./About";
import "./index.css";


class Main extends Component {

    constructor(props) {
      super(props);
      this.state={ navClass: "sidenav", shapeClass: "container"  }
      this.navToggle = this.navToggle.bind(this);
    }
    navToggle() { 
      if (this.state.navClass == "sidenav"){
        this.setState ({ navClass: "open sidenav", shapeClass: "container change"  })
      } else {
        this.setState ({ navClass: "sidenav" , shapeClass: "container" })
      }
  
  
      
    }
  
      render(){
          return(
    <HashRouter>
  <div>
    <div id="mySidenav" className={this.state.navClass}>
    <ul className="header">
       <li><NavLink to href="/Main">Home</NavLink></li>
       <li><NavLink to href="/Resume">Resume</NavLink></li>
       <li><NavLink to href="/Projects">Projects</NavLink></li>
       <li><NavLink to href="/About">About</NavLink></li>
    </ul> 
    </div>
    <div className="content">
            <Route path="/" component={Main}/>
            <Route path="/Resume" component={Resume}/>
            <Route path="/Projects" component={Projects}/>
            <Route path="/About" component={About}/>
    </div>

    <div id="main">
    <span onClick={()=>this.navToggle()} style={{cursor:"pointer"}}>
      <div className={this.state.shapeClass}>
        <div className="bar1"></div>
        <div className="bar2"></div>
        <div className="bar3"></div>
      </div>
    </span>

    </div>
  </div>
  </HashRouter>
      )  
    };
    
      
  };
 
export default Main;
